char* AppendDotConv(char* array)
{
    size_t len = strlen(array);

    char* ret = new char[len+6];

    strcpy(ret, array);
    ret[len] = '.'; ret[len+1] = 'c'; ret[len+2] = 'o'; ret[len+3] = 'n'; ret[len+4] = 'v';
    ret[len+5] = '\0';

    return ret;
}

